// And groups predicates with the AND operator between them.
func And(predicates ...predicate.Remediation) predicate.Remediation {
	return predicate.Remediation(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.Remediation) predicate.Remediation {
	return predicate.Remediation(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.Remediation) predicate.Remediation {
	return predicate.Remediation(sql.NotPredicates(p))
}
